import React from "react";

function Services() {
    return (
    <div className ="services">
        <div class = "row">
            <div class = "col">
                <div class = "left-services">
                   
                </div>
            </div>
            <div class = "col">
                <div class = "rightservices">
                <img id = "womancook" src="./images/WomanCook.svg" alt="Woman Cooking"/>
                
                </div>
            </div>
        </div>
    </div>
    );
}

export default Services;
